import React, { Component } from "react";
import { Card, Icon, Row } from "antd";
import "../App.css";

class Asset extends Component {
  state = { asset: 0 };

  render() {
    return (
      <Card hoverable>
        <h2>ETH</h2>
        <Row>
          <h3 style="width:50%;">{this.getAsset()}</h3>
          <h3 style="width:50%;">${this.getCurrency()}</h3>
        </Row>
      </Card>
    );
  }

  getAsset() {
    var num = this.state.asset;
    num = num.toFixed(4);
    return num;
  }

  getCurrency() {
    var cur = this.state.asset;
    cur = cur.toFixed(2);
    return cur;
  }
}

export default Asset;
